import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to <code>jseo977.github.io</code>!
        </p>
        <p>
          This is the beginning of my personal website, lets hope it turns out well ;)
        </p>
        <p> In the meantime, check out my <a href="https://www.linkedin.com/in/seojaemin/">Linkedin!</a></p>
      </header>
    </div>
  );
}

export default App;
